                        <h2><span style=""font-size: 14pt;""><strong>Các hình thức thanh toán tại du lịch Rour Rẻ</strong></span></h2>
                        <ol>
                            <li><span style=""font-size: 10pt;"">Thanh toán tiền mặt: Quý khách đến trực tiếp văn phòng của Tourre.vn tại số 24 Nguyễn Siêu để thanh toán và được tư vấn dịch vụ.</span></li>
                            <li><span style=""font-size: 10pt;"">Thanh toán bằng chuyển khoản</span></li>
                        </ol>");
            WriteLiteral(@"
                        <p><span style=""font-size: 10pt;"">Số tài khoản: 0011003237093 Vietcombank Nguyễn Thị Oanh</span></p>
                        <p><em><span style=""font-size: 10pt;""><strong>Lưu ý:</strong></span></em></p>
                        <ul>
                            <li><em><span style=""font-size: 10pt;"">khách hàng sẽ thanh toán số tiền đặt cọc hoặc tiền dịch vụ tour + phí giao dịch (phí giao dịch tủy thuộc vào cổng thanh toán mà quý khách lựa chọn)</span></em></li>
                            <li><span style=""font-size: 10pt;""><em>Các thông tin về thẻ của khách hàng hoàn toàn được bảo mật. Tourre.vn cam kết không cung cấp các thông tin này cho bên thứ b</em>a.</span></li>
                        </ul>
                        <h2><span style=""font-size: 10pt;""><strong><span style=""font-size: 14pt;"">Chính sách hủy tour</span> </strong></span></h2>
                        <p><span style=""font-size: 10pt;"">Tourre.vn không chịu trách nhiệm trước khách hàng về những thay đổi hoặc hủy bỏ củ");
            WriteLiteral(@"a dịch vụ bởi những lý do khách quan và bất khả kháng như: động đất, núi lửa, bão, chiến tranh, đình công, dịch bệnh, rồi loạn chính trị … Các giải pháp hoặc đền bù (nếu có) phụ thuộc vào các nhà cung cấp liên quan. Tourre.vn cam kết hỗ trợ khách hàng hết sức có thể để giảm thiểu thiệt hại.</span></p>
                        <ol>
                            <li>
                                <h3><span style=""font-size: 12pt;""><strong><em>Trường hợp hủy dịch vụ từ phía du lịch Tour Rẻ</em></strong></span></h3>
                            </li>
                        </ol>
                        <p><span style=""font-size: 10pt;"">Nếu Tour Rẻ không thực hiện dịch vụ đã cam kết thì Tour Rẻ phải thông báo điều này cho khách hàng và hoàn trả toàn bộ chi phí dịch vụ mà khách hàng đã chi trả.</span></p>
                        <ol start=""2"">
                            <li>
                                <h3><span style=""font-size: 12pt;""><em><strong>Trường hợp hủy dịch vụ từ phía khách hàng</strong></em");
            WriteLiteral(@"></span></h3>
                            </li>
                        </ol>
                        <p><span style=""font-size: 10pt;"">Khách hàng vui long thông báo cho nhân viên của Tour Rẻ nếu có nhu cầu hủy dịch vụ. Việc hủy dịch vụ cần được thực hiện qua email/fax. Tour Rẻ không chịu trách nhiệm với những dịch vụ hủy chưa có xác nhận bằng email/fax.</span></p>
                        <p><span style=""font-size: 10pt;"">Mức phí hoãn hủy tour/dịch vụ có thể từ 10 – 100% giá trị dịch vụ</span></p>
                        <p><span style=""font-size: 10pt;"">Các trường hợp hoãn hủy tour khách hàng sẽ nhận được hỗ trợ của Tour Rẻ (mức độ hỗ trợ tùy vào từng trường hợp)</span></p>
                        <h2><span style=""font-size: 14pt;""><strong>Trách nhiệm và cam kết khác</strong></span></h2>
                        <ol>
                            <li>
                                <h3><span style=""font-size: 12pt;""><em><strong>Về phía Tour Rẻ</strong></em></span></h3>
                            </l");
            WriteLiteral(@"i>
                        </ol>
                        <p><span style=""font-size: 10pt;"">Đảm bảo mọi dịch vụ theo đúng chương trình đã ký kết</span></p>
                        <p><span style=""font-size: 10pt;"">Phổ biến các thông tin cần thiết cho chuyến đi<strong>&nbsp;</strong></span></p>
                        <ol start=""2"">
                            <li>
                                <h3><span style=""font-size: 12pt;""><em><strong>Về phía khách hàng</strong></em></span></h3>
                            </li>
                        </ol>
                        <p><span style=""font-size: 10pt;"">Thanh toán đầy đủ đúng hạn</span></p>
                        <p><span style=""font-size: 10pt;"">Tuân thủ theo chương trình và chỉ dẫn của hướng dẫn viên trong chương trình</span></p>
                        <p><span style=""font-size: 10pt;"">Cung cấp các giấy tờ cá nhân cần thiết trong chương trình</span></p>
                        <p><span style=""font-size: 10pt;"">Tuân thủ các quy định của pháp l");
            WriteLiteral(@"uật tại địa phương</span></p>
                        <p><span style=""font-size: 10pt;"">Khách hàng phải chịu trách nhiệm thanh toán các chi phí phát sinh do việc vi phạm gây ra. Tour Rẻ chỉ có trách nhiệm giúp đỡ khách hàng nhằm giảm thiểu thiệt hại.</span></p>
                        <h2><span style=""font-size: 14pt;""><strong>Khiếu nại và bồi thường</strong></span></h2>
                        <p><span style=""font-size: 10pt;"">Trong trường hợp khách hàng có khiếu nại đến Tour Rẻ, trước hết quý khách vui lòng liên hệ trực tiếp với trưởng đoàn/ hướng dẫn viên để nhận được hỗ trợ. Nếu vấn đề chưa được giải quyết thỏa đáng vui lòng liên hệ với đại diện bán hàng của Tour Rẻ. Chúng tôi cam kết sẽ hỗ trợ và giải quyết các vấn đề của khách hàng sớm và chính xác nhất có thể.</span></p>
                        <h2><span style=""font-size: 14pt;""><strong>Các chương trình khuyến mãi</strong></span></h2>
